import React from "react";
import { useParams } from "react-router-dom";
import { useNavigate } from "react-router-dom";
import { useState,useEffect } from "react";
import axios from "axios";

const initialState={
    firstName: "",
  lastName: "",
  role: "",
  emailId: "",
  password: "",
  gender: "",
  contactNo: "",
  age: "",
  street: "",
  city: "",
  pincode: ""
}


const AdminPage = () =>{
    const navigate = useNavigate();
    const{name} = useParams();
    const[managers,setManagers] = useState(initialState);

    const handleClick = (e)=>{
        e.preventDefault();
        navigate(`/managerRegister`);
    }
    useEffect(()=>{
        const fetchManagers = async() =>{
            try{
                const response = await axios.get(`http://localhost:8080/manager/getManagers`);
                const data= response.data;
                setManagers(data);
                
            }
            catch(error){
                console.log("Error fetching managers: ",error);
            }

        }
        fetchManagers();
    },[]);
    return(
        <React.Fragment>
            <h1 className="title">Welcome {name}</h1>
            <button className ="btn" onClick = {handleClick}>Add Manager</button>

            <table>
                <thead>
                <tr>
                    <th>FirstName</th>
                    <th>LastName</th>
                    <th>EmailId</th>
                    <th>PhoneNo</th>
                    <th>Address</th>
                    <th>Actions</th>
                </tr>
                </thead>
                <tbody>
                    {managers.map((manager,index)=>(
                        <tr>
                            
                        </tr>
                        
                    ))}
                </tbody>
            </table>
        </React.Fragment>
    )
}

export default AdminPage;
